import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import ToggleButtons from './components/ToggleButtons';
import MainContent from './components/MainContent';
import SecondaryContent from './components/SecondaryContent';
import FloatingIcons from './components/FloatingIcons';
import BoxLinks from './components/BoxLinks'; // Import the new clickable boxes
import Projects from './components/Projects';
import SocialMedia from './components/SocialMedia';
import Certificates from './components/Certificates';

const App = () => {
    return (
        <Router>
            <div className="App">
                <Header /> {/* Header stays consistent across pages */}
                <FloatingIcons /> {/* Floating icons remain on all pages */}
                <Routes>
                    {/* Home page with all current components */}
                    <Route
                        path="/"
                        element={
                            <>
                                <ToggleButtons />
                                <MainContent />
                                <SecondaryContent />
                                <BoxLinks /> {/* Include the new box links here */}
                            </>
                        }
                    />
                    {/* Individual pages for Projects, Social Media, and Certificates */}
                    <Route path="/projects" element={<Projects />} />
                    <Route path="/social-media" element={<SocialMedia />} />
                    <Route path="/certificates" element={<Certificates />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
